    const {products} = useContext(DataContext)

        return (
            <React.Fragment>
                <div className="row">
                {
                    products.map( item =>{
                        return <Menu key={item.id} item={item}/>
                    }
                    )
                }
                {/* <Menu></Menu> */}
                </div>
            </React.Fragment>
        )
    }


export default MenuList
